import React from "react";
import { Link, NavLink } from "react-router-dom";

export default function Navbar() {
  const link =
    "px-3 py-2 rounded hover:opacity-80 transition";

  const active = ({ isActive }) =>
    (isActive ? "font-semibold underline " : "") + link;

  return (
    <nav className="flex items-center justify-between px-6 py-4">
      <Link to="/" className="text-xl font-bold">Final10</Link>
      <div className="flex gap-4">
        <NavLink to="/auctions" className={active}>Auctions</NavLink>
        <NavLink to="/alerts" className={active}>Alerts</NavLink>
        <NavLink to="/points" className={active}>Points</NavLink>
      </div>
      <div className="flex gap-3">
        <Link to="/login" className={link}>Login</Link>
        <Link to="/register" className={link}>Sign Up</Link>
      </div>
    </nav>
  );
}
